import React, { Component } from 'react';
import './TodoItem.css'
class TodoItem extends Component {
    
    render() {
        let className = "TodoItem";
        const item = this.props.item;
        if(item.isCompleted === true) {
            className += "-completed";
        }
        return (
            <div className={className}>
                <p>{item.title}</p>
            </div>
        );        
    }
}

export default TodoItem;
